P(X = x, Y = y) = \frac{x + y}{18} \quad\text{ }\quad (x, y) \\{0, 1, 2\} \times \{0, 1, 2\}
\]Find conditional \(P(Y = y \mid X = x)\).Find conditional \(P(Y = y \mid X = x)\).conditional 
\[
P(Y = y \mid X = x) = \frac{P(X = x, Y = y)}{P(X = x)}
\]conditional \[
P(Y = y \mid X = x) = \frac{P(X = x, Y = y)}{P(X = x)}
\]find \(P(X = x)\) — marginal distribution \(X\):
\[
\begin{aligned}
P(X = x) &= \sum_{y \\{0, 1, 2\}} P(X = x, Y = y) \\
&= P(X = x, Y = 0) + P(X = x, Y = 1) + P(X = x, Y = 2) \\
&= \frac{x + x + 1 + x + 2}{18} \\
&= \frac{x + 1}{6}
\end{aligned}
\]find \(P(X = x)\) — marginal distribution \(X\):\[
\begin{aligned}
P(X = x) &= \sum_{y \\{0, 1, 2\}} P(X = x, Y = y) \\
&= P(X = x, Y = 0) + P(X = x, Y = 1) + P(X = x, Y = 2) \\
&= \frac{x + x + 1 + x + 2}{18} \\
&= \frac{x + 1}{6}
\end{aligned}
\]Now
\[
\begin{aligned}
P(Y = y \mid X = x)
&= \frac{P(X = x, Y = y)}{P(X = x)} \\
&= \frac{\frac{x + y}{18}}{\frac{x + 1}{6}} \\
&= \frac{x + y}{3(x + 1)}
\end{aligned}
\]Now\[
\begin{aligned}
P(Y = y \mid X = x)
&= \frac{P(X = x, Y = y)}{P(X = x)} \\
&= \frac{\frac{x + y}{18}}{\frac{x + 1}{6}} \\
&= \frac{x + y}{3(x + 1)}
\end{aligned}
